import{_ as e,a,b as i,c as l,d as o,e as d,f as p,g as s,h as n,i as c,j as h,k as m,l as u,m as f,n as g,o as _,p as b,q as C,r as k,s as v,t as A}from"./chunks/qgc_airframe_generic_quadx.CbkbXFf6.js";import{_ as P,c as S,a8 as w,j as t,a as y,o as V}from"./chunks/framework.BDnHobkS.js";const U=JSON.parse('{"title":"Збірка DJI FlameWheel 450 + CUAV V5+","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/dji_f450_cuav_5plus.md","filePath":"uk/frames_multicopter/dji_f450_cuav_5plus.md"}'),x={name:"uk/frames_multicopter/dji_f450_cuav_5plus.md"};function F(q,r,I,D,T,G){return V(),S("div",null,r[0]||(r[0]=[w('<h1 id="збірка-dji-flamewheel-450-cuav-v5" tabindex="-1">Збірка DJI FlameWheel 450 + CUAV V5+ <a class="header-anchor" href="#збірка-dji-flamewheel-450-cuav-v5" aria-label="Permalink to &quot;Збірка DJI FlameWheel 450 + CUAV V5+&quot;">​</a></h1><p>This topic provides full instructions for building the kit and configuring PX4 using <em>QGroundControl</em>.</p><p>Основна Інформація</p><ul><li><strong>Frame:</strong> DJI F450</li><li><strong>Flight controller:</strong> <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a></li><li><strong>Assembly time (approx.):</strong> 90 minutes (45 minutes for frame, 45 minutes autopilot installation/configuration)</li></ul><p><img src="'+e+'" alt="Finished setup 1"></p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><p>Компоненти, необхідні для цієї збірки, є:</p><ul><li>Flight controller: <a href="https://store.cuav.net/index.php?id_product=95&amp;id_product_attribute=0&amp;rewrite=cuav-new-pixhack-v5-autopilot-m8n-gps-for-fpv-rc-drone-quadcopter-helicopter-flight-simulator-free-shipping-whole-sale&amp;controller=product&amp;id_lang=1" target="_blank" rel="noreferrer">CUAV V5+</a>: <ul><li>GPS: <a href="https://store.cuav.net/index.php?id_product=97&amp;id_product_attribute=0&amp;rewrite=cuav-new-ublox-neo-m8n-gps-module-with-shell-stand-holder-for-flight-controller-gps-compass-for-pixhack-v5-plus-rc-parts-px4&amp;controller=product&amp;id_lang=1" target="_blank" rel="noreferrer">CUAV NEO V2 GPS</a></li><li>Модуль живлення</li></ul></li><li>Frame: <a href="https://www.amazon.com/Flame-Wheel-Basic-Quadcopter-Drone/dp/B00HNMVQHY" target="_blank" rel="noreferrer">DJI F450</a></li><li>Propellers: <a href="https://www.masterairscrew.com/products/dji-phantom-built-in-nut-upgrade-propellers-in-black-mr-9-4x5-prop-set-x4-phantom" target="_blank" rel="noreferrer">DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</a></li><li>Battery: <a href="https://hobbyking.com/en_us/turnigy-high-capacity-5200mah-3s-12c-multi-rotor-lipo-pack-w-xt60.html?___store=en_us" target="_blank" rel="noreferrer">Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</a></li><li>Telemetry: <a href="./../telemetry/holybro_sik_radio.html">Holybro Transceiver Telemetry Radio V3</a></li><li>RC Receiver: <a href="https://www.banggood.com/FrSky-D4R-II-2_4G-4CH-ACCST-Telemetry-Receiver-for-RC-Drone-FPV-Racing-p-929069.html?cur_warehouse=GWTR" target="_blank" rel="noreferrer">FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</a></li><li>Motors: <a href="https://www.amazon.com/DJI-E305-2312E-Motor-960kv/dp/B072MBMCZN" target="_blank" rel="noreferrer">DJI E305 2312E Motor (960kv,CW)</a></li><li>ESC: Hobbywing XRotor 20A APAC Brushless ESC 3-4S для RC Мультикоптерів</li></ul><p>Крім того, ми використовували контролер FrSky Taranis. Вам також знадобляться хомутів, двостороння стрічка, паяльник.</p><p>На наведеному нижче зображенні показані як рама, так і електронні компоненти.</p><p><img src="'+a+'" alt="All components used in this build"></p><h2 id="апаратне-забезпечення-hardware" tabindex="-1">Апаратне забезпечення(Hardware) <a class="header-anchor" href="#апаратне-забезпечення-hardware" aria-label="Permalink to &quot;Апаратне забезпечення(Hardware)&quot;">​</a></h2><h3 id="frame" tabindex="-1">Frame <a class="header-anchor" href="#frame" aria-label="Permalink to &quot;Frame&quot;">​</a></h3><p>Цей розділ містить усе обладнання для каркасів.</p><table tabindex="0"><thead><tr><th>Опис</th><th>Кількість</th></tr></thead><tbody><tr><td>DJI F450 Нижня пластина</td><td>1</td></tr><tr><td>DJI F450 Верхня пластина</td><td>1</td></tr><tr><td>DJI F450 ніжки з шасі</td><td>4</td></tr><tr><td>Гвинти M3*8</td><td>18</td></tr><tr><td>Гвинти M2 5*6</td><td>24</td></tr><tr><td>Акумуляторний ремінь на липучці</td><td>1</td></tr><tr><td>DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</td><td>1</td></tr></tbody></table><p><img src="'+i+'" alt="F450 frame components"></p><h3 id="набір-cuav-v5" tabindex="-1">Набір CUAV V5+ <a class="header-anchor" href="#набір-cuav-v5" aria-label="Permalink to &quot;Набір CUAV V5+&quot;">​</a></h3><p>У цьому розділі перераховані компоненти в наборі CUAV v5+.</p><table tabindex="0"><thead><tr><th>Опис</th><th>Кількість (Набір за замовчуванням)</th><th>Кількість (+GPS Набір)</th></tr></thead><tbody><tr><td>Автопілот V5+</td><td>1</td><td>1</td></tr><tr><td>Кабель DuPont</td><td>2</td><td>2</td></tr><tr><td>Кабель I2C/CAN</td><td>2</td><td>2</td></tr><tr><td>Кабель ADC 6.6</td><td>2</td><td>2</td></tr><tr><td>Сигнальний кабель SBUS</td><td>1</td><td>1</td></tr><tr><td>Кабель IRSSI</td><td>1</td><td>1</td></tr><tr><td>Сигнальний кабель DSM</td><td>1</td><td>1</td></tr><tr><td>Кабель ADC 3.3</td><td>1</td><td>1</td></tr><tr><td>Кабель для відладки</td><td>1</td><td>1</td></tr><tr><td>Кабель запобіжного вимикача</td><td>1</td><td>1</td></tr><tr><td>Voltage &amp; Current Cable</td><td>1</td><td>1</td></tr><tr><td>Кабель модуля PW-Link</td><td>1</td><td>1</td></tr><tr><td>Модуль живлення</td><td>1</td><td>1</td></tr><tr><td>Карта пам&#39;яті SanDisk 16GB</td><td>1</td><td>1</td></tr><tr><td>Платка розширення 12C</td><td>1</td><td>1</td></tr><tr><td>ТТЛ-пластина</td><td>1</td><td>1</td></tr><tr><td>NEO GPS</td><td>-</td><td>1</td></tr><tr><td>GPS Bracket</td><td>-</td><td>1</td></tr></tbody></table><p><img src="'+l+'" alt="CUAV V5+ components"></p><h3 id="електроніка" tabindex="-1">Електроніка <a class="header-anchor" href="#електроніка" aria-label="Permalink to &quot;Електроніка&quot;">​</a></h3><table tabindex="0"><thead><tr><th>Опис</th><th>Кількість</th></tr></thead><tbody><tr><td>CUAV V5+</td><td>1</td></tr><tr><td>CUAV NEO V2 GPS</td><td>1</td></tr><tr><td>Holibro Telemetry</td><td>1</td></tr><tr><td>FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</td><td>1</td></tr><tr><td>DJI E305 2312E Motor (800kv,CW)</td><td>4</td></tr><tr><td>Hobbywing XRotor 20A APAC Brushless ESC</td><td>4</td></tr><tr><td>Модуль живлення (включено в набір CUAV V5+)</td><td>1</td></tr><tr><td>Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</td><td>1</td></tr></tbody></table><h3 id="необхідні-інструменти" tabindex="-1">Необхідні інструменти <a class="header-anchor" href="#необхідні-інструменти" aria-label="Permalink to &quot;Необхідні інструменти&quot;">​</a></h3><p>У цій збірці використовуються наступні інструменти:</p><ul><li>Викрутка з шестигранником 2,0 мм</li><li>Шуруповерт Phillips 3 мм</li><li>Кусачки</li><li>Прецизійний пінцет</li><li>Паяльник</li></ul><p><img src="'+o+'" alt="Required tools"></p><h2 id="збірка" tabindex="-1">Збірка <a class="header-anchor" href="#збірка" aria-label="Permalink to &quot;Збірка&quot;">​</a></h2><p>Приблизний час для збирання становить приблизно 90 хвилин (близько 45 хвилин на раму та 45 хвилин на встановлення автопілота та налаштування корпусу.</p><ol><li><p>Прикріпіть 4 ніжки до нижньої пластини за допомогою наданих гвинтів.</p><p><img src="'+d+'" alt="Arms to bottom plate"></p></li><li><p>Припаяйте ЕСК (електронний регулятор швидкості) до плати, позитивний (червоний) та негативний (чорний).</p><p><img src="'+p+'" alt="Solder ESCs"></p></li><li><p>Припаяйте модуль живлення, позитивний (червоний) та негативний (чорний).</p><p><img src="'+s+'" alt="Solder power module"></p></li><li><p>Підключіть двигуни до ESC відповідно до їхніх позицій.</p><p><img src="'+n+'" alt="Plug in motors"></p></li><li><p>Прикріпіть двигуни до відповідних рук.</p><p><img src="'+c+'" alt="Attach motors to arms (white)"><img src="'+h+'" alt="Attach motors to arms (red)"></p></li><li><p>Додайте верхню дошку (прикрутіть до верхньої частини ніг).</p><p><img src="'+m+'" alt="Add top board"></p></li><li><p>Додайте двосторонній скотч (3M) до контролера польоту CUAV V5+ (він має внутрішнє гасіння вібрацій, тому використовувати піну не потрібно).</p><p><img src="'+u+'" alt="Tape CUAV v5+"></p></li><li><p>Прикріпіть приймач FrSky до нижньої плати за допомогою двосторонньої стрічки.</p><p><img src="'+f+'" alt="Attach FrSky receiver with double-sided tape"></p></li><li><p>Прикріпіть телеметричний модуль до нижньої плати транспортного засобу за допомогою двосторонньої стрічки.</p><p><img src="'+g+'" alt="Attach telemetry radio"><img src="'+_+'" alt="Attach telemetry radio"></p></li><li><p>Поставте алюмінієві опори на платформу кнопок.</p></li><li><p>Plug in Telemetry (<code>TELEM1</code>) and GPS module (<code>GPS/SAFETY</code>) to the flight controller. <img src="'+b+'" alt="Attach GPS"><img src="'+C+'" alt="Attach GPS"></p></li><li><p>Plug in the RC receiver (<code>RC</code>), all 4 ESC’s (<code>M1-M4</code>), and the power module (<code>Power1</code>) into the flight controller. <img src="'+k+'" alt="Attach peripherals to flight controller"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The motor order is defined in the <a href="./../airframes/airframe_reference.html#quadrotor-x">Airframe Reference &gt; Quadrotor x</a></p></div></li></ol><p>:::</p><p>Ось і все! Останню збірку показано нижче:</p><p><img src="'+v+'" alt="Finished Setup"></p><h2 id="конфігурація-px4" tabindex="-1">Конфігурація PX4 <a class="header-anchor" href="#конфігурація-px4" aria-label="Permalink to &quot;Конфігурація PX4&quot;">​</a></h2><p><em>QGroundControl</em> is used to install the PX4 autopilot and configure/tune it for the frame. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Download and install</a><em>QGroundControl</em> for your platform.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Full instructions for installing and configuring PX4 can be found in <a href="./../config/">Basic Configuration</a>.</p></div><p>Спочатку оновіть прошивку, конструкцію та виходи:</p><ul><li><p><a href="./../config/firmware.html">Firmware</a></p></li><li><p><a href="./../config/airframe.html">Airframe</a></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You will need to select the <em>Generic Quadcopter</em> airframe (<strong>Quadrotor x &gt; Generic Quadcopter</strong>).</p><p><img src="'+A+'" alt="QGroundControl - Select Generic Quadcopter"></p></div></li></ul><p>:::</p><ul><li><a href="./../config/actuators.html">Actuators</a><ul><li>Оновіть геометрію транспортного засобу, щоб вона відповідала рамі.</li><li>Призначте функції приводу до актуаторів, щоб відповідати вашому підключенню.</li><li>Перевірте конфігурацію, використовуючи слайдери.</li></ul></li></ul><p>Потім виконайте обов&#39;язкове налаштування / калібрування:</p><ul><li><p><a href="./../config/flight_controller_orientation.html">Sensor Orientation</a></p></li><li><p><a href="./../config/compass.html">Компас</a></p></li><li><p><a href="./../config/accelerometer.html">Акселерометр</a></p></li><li><p><a href="./../config/level_horizon_calibration.html">Level Horizon Calibration</a></p></li><li><p><a href="./../config/radio.html">Radio Setup</a></p></li><li><p><a href="./../config/flight_mode.html">Flight Modes</a></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For this build we set up modes <em>Stabilized</em>, <em>Altitude</em> and <em>Position</em> on a three-way switch on the receiver (mapped to a single channel - 5). Це рекомендований мінімальний набір режимів для початківців.</p></div></li></ul><p>:::</p><p>В ідеалі ви також повинні зробити:</p><ul><li><a href="./../advanced_config/esc_calibration.html">ESC Calibration</a></li><li><a href="./../config/battery.html">Battery Estimation Tuning</a></li><li><a href="./../config/safety.html">Safety</a></li></ul><h2 id="вдосконалення" tabindex="-1">Вдосконалення <a class="header-anchor" href="#вдосконалення" aria-label="Permalink to &quot;Вдосконалення&quot;">​</a></h2><p>Airframe selection sets <em>default</em> autopilot parameters for the frame. Ці можуть бути достатньо хороші для польоту, але вам слід налаштувати кожну конструкцію рами.</p><p>For instructions on how, start from <a href="./../config/autotune_mc.html">Autotune</a>.</p><h2 id="відео" tabindex="-1">Відео <a class="header-anchor" href="#відео" aria-label="Permalink to &quot;Відео&quot;">​</a></h2>',48),t("lite-youtube",{videoid:"r-IkaVpN1Ko",title:"CUAV V5+"},null,-1),t("h2",{id:"подяки",tabindex:"-1"},[y("Подяки "),t("a",{class:"header-anchor",href:"#подяки","aria-label":'Permalink to "Подяки"'},"​")],-1),t("p",null,"Цей журнал збірки був наданий Командою тестового польоту Dronecode.",-1)]))}const B=P(x,[["render",F]]);export{U as __pageData,B as default};
